  return (
    <div className="downer symbol-box">
      <h2 id="symbol">TEST</h2>
      <p className="price price-down-${i}">Price: $TEST</p>
      <div className="changes-row">
        <p className="changePercentageDown-${i}">$TEST%</p>
        <img id="downArrow" src="./images/downArrow.svg"/>
        <p>$TEST</p>
      </div>
    </div>
  );
};

export default BearContainer;
